import React from "react";
import "./App.css";
import Title from "./components/Title";
import Header from "./components/Header";
import List from "./components/List";
class App extends React.Component {
  render() {
    return (
      <div className="main">
        <div className="container">
          <Title />
          <Header />
          <List />
        </div>
      </div>
    );
  }
}

export default App;
